const u=[{id:"fish_revolution",width:"1024",height:"600",name:"Fish!Revolution",preview:"/images/fish_revolution.png",stack:"Godot",embed_link:"https://itch.io/embed-upload/15235000?color=333333",link:"https://saphielle.itch.io/fishrevolution",about_en:"Made by me and my friends for a jam session in 5 days. Theme: revolution.",about_ru:"\u0421\u0434\u0435\u043B\u0430\u043D\u043E \u0432 \u043A\u043E\u043C\u0430\u043D\u0434\u0435 \u043C\u043D\u043E\u0439 \u0438 \u043C\u043E\u0438\u043C\u0438 \u0434\u0440\u0443\u0437\u044C\u044F\u043C\u0438 \u0434\u043B\u044F \u0434\u0436\u0435\u043C\u0430 \u0437\u0430 5 \u0434\u043D\u0435\u0439. \u0422\u0435\u043C\u0430: revolution.",github:"https://github.com/sialiss/interstellar-gamejam2025"},{id:"xenotrauma",width:"1024",height:"600",name:"XenoTrauma",preview:"/images/xenotrauma2.png",stack:"Godot",embed_link:"https://itch.io/embed-upload/8287029?color=0f153b",link:"https://saphielle.itch.io/xenotrauma",about_en:"We (me and two of my friends) participated in GMTK GameJam 2023, where we had to make a game on a given topic in 48 hours. That year the theme was 'Roles reversed', so we made a game where you play as a monster in the sea. Our theme is based on Barotrauma. Doesn't work very well in the browser, but you can download it!",about_ru:"\u041C\u044B (\u044F \u0438 \u0434\u0432\u043E\u0435 \u043C\u043E\u0438\u0445 \u0434\u0440\u0443\u0437\u0435\u0439) \u0443\u0447\u0430\u0441\u0442\u0432\u043E\u0432\u0430\u043B\u0438 \u0432 GMTK GameJam 2023, \u0433\u0434\u0435 \u043D\u0443\u0436\u043D\u043E \u0431\u044B\u043B\u043E \u0441\u0434\u0435\u043B\u0430\u0442\u044C \u0438\u0433\u0440\u0443 \u043D\u0430 \u0437\u0430\u0434\u0430\u043D\u043D\u0443\u044E \u0442\u0435\u043C\u0443 \u0437\u0430 48 \u0447\u0430\u0441\u043E\u0432. \u0412 \u0442\u043E\u043C \u0433\u043E\u0434\u0443 \u0442\u0435\u043C\u0430 \u0431\u044B\u043B\u0430 \xAB\u0421\u043C\u0435\u043D\u0430 \u0440\u043E\u043B\u0435\u0439\xBB, \u043F\u043E\u044D\u0442\u043E\u043C\u0443 \u043C\u044B \u0441\u0434\u0435\u043B\u0430\u043B\u0438 \u0438\u0433\u0440\u0443, \u0432 \u043A\u043E\u0442\u043E\u0440\u043E\u0439 \u0432\u044B \u0438\u0433\u0440\u0430\u0435\u0442\u0435 \u0437\u0430 \u043C\u043E\u0440\u0441\u043A\u043E\u0435 \u0447\u0443\u0434\u043E\u0432\u0438\u0449\u0435. \u0418\u0433\u0440\u0430 \u0432\u0434\u043E\u0445\u043D\u043E\u0432\u043B\u0435\u043D\u0430 Barotrauma. \u0411\u0440\u0430\u0443\u0437\u0435\u0440\u043D\u0430\u044F \u0432\u0435\u0440\u0441\u0438\u044F \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442 \u043D\u0435 \u043E\u0447\u0435\u043D\u044C \u0445\u043E\u0440\u043E\u0448\u043E, \u043D\u043E \u0438\u0433\u0440\u0443 \u043C\u043E\u0436\u043D\u043E \u0441\u043A\u0430\u0447\u0430\u0442\u044C!",github:"https://github.com/sialiss/GMTK-gamejam2023"},{id:"flowerize",width:"1024",height:"600",name:"Flowerize",preview:"/images/flowerize2.png",stack:"Godot",embed_link:"https://itch.io/embed-upload/6450745?color=ACC6D0",link:"https://saphielle.itch.io/flowerize",about_en:"Made by me and my friend for Kenney GameJam 2022. Theme: growth, 2 day limit. I created gamedesign (idea, mechanics, level design) and art (stylistics, animations, coloring, music). The assets are made by Kenney (it's the jam condition), but the player character is created from a combination of two assets, and I drew the animations frame by frame.",about_ru:"\u0421\u0434\u0435\u043B\u0430\u043D\u043E \u043C\u043D\u043E\u0439 \u0438 \u043C\u043E\u0435\u0439 \u043F\u043E\u0434\u0440\u0443\u0433\u043E\u0439 \u0434\u043B\u044F Kenney GameJam 2022. \u0422\u0435\u043C\u0430: \u0440\u043E\u0441\u0442, \u0441\u0440\u043E\u043A \u2014 2 \u0434\u043D\u044F. \u042F \u0437\u0430\u043D\u0438\u043C\u0430\u043B\u0430\u0441\u044C \u0433\u0435\u0439\u043C\u0434\u0438\u0437\u0430\u0439\u043D\u043E\u043C (\u0438\u0434\u0435\u044F, \u043C\u0435\u0445\u0430\u043D\u0438\u043A\u0438, \u0434\u0438\u0437\u0430\u0439\u043D \u0443\u0440\u043E\u0432\u043D\u0435\u0439) \u0438 \u043E\u0444\u043E\u0440\u043C\u043B\u0435\u043D\u0438\u0435\u043C (\u0441\u0442\u0438\u043B\u0438\u0441\u0442\u0438\u043A\u0430, \u0430\u043D\u0438\u043C\u0430\u0446\u0438\u0438, \u0440\u0430\u0441\u043A\u0440\u0430\u0441\u043A\u0430, \u043C\u0443\u0437\u044B\u043A\u0430). \u0410\u0441\u0441\u0435\u0442\u044B \u043F\u0440\u0435\u0434\u043E\u0441\u0442\u0430\u0432\u043B\u0435\u043D\u044B Kenney (\u044D\u0442\u043E \u0443\u0441\u043B\u043E\u0432\u0438\u0435 \u0434\u0436\u0435\u043C\u0430), \u043D\u043E \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436 \u0441\u043E\u0431\u0440\u0430\u043D \u0438\u0437 \u0434\u0432\u0443\u0445 \u0430\u0441\u0441\u0435\u0442\u043E\u0432, \u0430 \u0430\u043D\u0438\u043C\u0430\u0446\u0438\u0438 \u044F \u0440\u0438\u0441\u043E\u0432\u0430\u043B\u0430 \u043F\u043E\u043A\u0430\u0434\u0440\u043E\u0432\u043E.",github:"https://github.com/sialiss/GMTK-gamejam2022"},{id:"dice",width:"1024",height:"600",name:"Oh no! The dice came to life!",preview:"/images/dice2.png",stack:"Godot",embed_link:"https://itch.io/embed-upload/6179916?color=333333",link:"https://saphielle.itch.io/oh-no-the-dice-came-to-life",about_en:"We (me and two of my friends) participated in GMTK GameJam 2022, where we had to make a game on a given topic in 48 hours. This year the theme was 'Roll the dice', so we made a game where you play as a dice that is attacked by players' pieces (hats and pawns). Depending on the number on the top edge, different abilities are used, and HP is displayed as the progress of passing the chip to the end (this is from the bottom).",about_ru:"\u041C\u044B (\u044F \u0438 \u0434\u0432\u043E\u0435 \u043C\u043E\u0438\u0445 \u0434\u0440\u0443\u0437\u0435\u0439) \u0443\u0447\u0430\u0441\u0442\u0432\u043E\u0432\u0430\u043B\u0438 \u0432 GMTK GameJam 2022, \u0433\u0434\u0435 \u043D\u0443\u0436\u043D\u043E \u0431\u044B\u043B\u043E \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u0438\u0433\u0440\u0443 \u043D\u0430 \u0437\u0430\u0434\u0430\u043D\u043D\u0443\u044E \u0442\u0435\u043C\u0443 \u0437\u0430 48 \u0447\u0430\u0441\u043E\u0432. \u0422\u0435\u043C\u043E\u0439 \u0433\u043E\u0434\u0430 \u0431\u044B\u043B\u043E \xAB\u0411\u0440\u043E\u0441\u044C \u043A\u043E\u0441\u0442\u0438\xBB, \u0438 \u043C\u044B \u0441\u0434\u0435\u043B\u0430\u043B\u0438 \u0438\u0433\u0440\u0443, \u0433\u0434\u0435 \u0432\u044B \u0438\u0433\u0440\u0430\u0435\u0442\u0435 \u0437\u0430 \u043A\u0443\u0431\u0438\u043A, \u043D\u0430 \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043D\u0430\u043F\u0430\u0434\u0430\u044E\u0442 \u0444\u0438\u0448\u043A\u0438 \u0438\u0433\u0440\u043E\u043A\u043E\u0432 (\u0448\u043B\u044F\u043F\u044B \u0438 \u043F\u0435\u0448\u043A\u0438). \u0412 \u0437\u0430\u0432\u0438\u0441\u0438\u043C\u043E\u0441\u0442\u0438 \u043E\u0442 \u0447\u0438\u0441\u043B\u0430 \u043D\u0430 \u0432\u0435\u0440\u0445\u043D\u0435\u0439 \u0433\u0440\u0430\u043D\u0438 \u0430\u043A\u0442\u0438\u0432\u0438\u0440\u0443\u044E\u0442\u0441\u044F \u0440\u0430\u0437\u043D\u044B\u0435 \u0441\u043F\u043E\u0441\u043E\u0431\u043D\u043E\u0441\u0442\u0438, \u0430 \u0437\u0434\u043E\u0440\u043E\u0432\u044C\u0435 \u043E\u0442\u043E\u0431\u0440\u0430\u0436\u0430\u0435\u0442\u0441\u044F \u043A\u0430\u043A \u043F\u0440\u043E\u0433\u0440\u0435\u0441\u0441 \u043F\u0440\u043E\u0445\u043E\u0436\u0434\u0435\u043D\u0438\u044F \u0444\u0438\u0448\u043A\u0438 \u0434\u043E \u043A\u043E\u043D\u0446\u0430 (\u043E\u043D\u043E \u0441\u043D\u0438\u0437\u0443).",github:"https://github.com/sialiss/GMTK-gamejam2022"}];export{u as p};
